// src/pages/DashboardMedico.js

import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Container, Row, Col } from 'react-bootstrap';

function DashboardMedico() {
    return (
        <Container>
            <h2>Dashboard do Médico</h2>
            <Row>
                <Col md={4}>
                    <Link to="/consultas-agendadas">
                        <Button variant="primary" className="w-100">Ver Consultas Agendadas</Button>
                    </Link>
                </Col>
                <Col md={4}>
                    <Link to="/cadastrar-exame">
                        <Button variant="success" className="w-100">Cadastrar Exame</Button>
                    </Link>
                </Col>
                <Col md={4}>
                    <Link to="/adicionar-horarios">
                        <Button variant="info" className="w-100">Adicionar Horários</Button>
                    </Link>
                </Col>
            </Row>
        </Container>
    );
}

export default DashboardMedico;
